function generateLists(CURRENT_SOURCE) {
currentdeviceselect.innerHTML = '';
calculateddeviceselect.innerHTML = '';
for (i in CURRENT_SOURCE) {
	newElement = document.createElement('option');
	newElement.value = CURRENT_SOURCE[i][1];
	newElement.textContent = CURRENT_SOURCE[i][0];
	currentdeviceselect.appendChild(newElement);
}

for (i in CURRENT_SOURCE) {
	newElement = document.createElement('option');
	newElement.value = CURRENT_SOURCE[i][1];
	newElement.textContent = CURRENT_SOURCE[i][0];
	calculateddeviceselect.appendChild(newElement);
}
}

generateLists(SHEEPIT);

function updateAll() {
	timeinsecs = (parseInt(currentdeviceminutes.value)*60)+parseInt(currentdeviceseconds.value)
	//NEWSOURCESHERE
	if (source == "SHEEPIT") {
		time = timeinsecs*(parseInt(currentdeviceselect.value)/100)/(parseInt(calculateddeviceselect.value)/100)
	} else if (source == "LTT") {
		time = timeinsecs/parseInt(currentdeviceselect.value)*parseInt(calculateddeviceselect.value)
	}
	console.log(time);
	time = time.toFixed(2);
	minutes = Math.floor(time / 60);
	calculateddevicemins.textContent = minutes;
	calculateddevicesecs.textContent = time - minutes * 60;
	
	//Frames Calculation
	timewithframes = time*parseInt(FPS.value)*parseInt(framesCount.value);
	days = Math.floor(timewithframes / 60 / 60 / 24);
	hours = Math.floor(timewithframes / 60 / 60) - days * 24;
	minutes = Math.floor(timewithframes / 60) - hours * 60;
	
	console.log(days);
	console.log(hours);
	console.log(minutes);
	
	daysTaken.textContent = days;
	hoursTaken.textContent = hours;
	minutesTaken.textContent = minutes;
}

currentdeviceselect.onchange = updateAll;
calculateddeviceselect.onchange = updateAll;
currentdeviceminutes.onchange = updateAll;
currentdeviceseconds.onchange = updateAll;
framesCount.onchange = updateAll;
FPS.onchange = updateAll;

function dataSourceUpdate() {
	//NEWSOURCESHERE
	if (dataSource.value == "SHEEPIT") {
		generateLists(SHEEPIT);
		source = "SHEEPIT";
	}
	if (dataSource.value == "LTT") {
		generateLists(LTT);
		source = "LTT";
	}
}

